import React, { useState } from "react";
import MapCanvas from "./MapCanvas";
import { Form } from "react-bootstrap";
import "./Form.scss";

const DrawRouteForm = ({ eapObject, setEAPObject, incrementStep }) => {
  const [base64Image, setBase64Image] = useState("");
  const [requiredMessage, setRequiredMessage] = useState("");

  const exampleURL =
    "https://maps.googleapis.com/maps/api/staticmap?center=Berkeley,CA&zoom=17&size=400x400&key=YOUR_API_KEY&signature=YOUR_SIGNATURE";

  const imgSource =
    "data:image/png;base64,";

  const createGoogleMapsAPIURL = () => {
    let URL = "";
    Object.keys(eapObject.address).forEach((value) => {
      URL += eapObject.address[value].replace(" ", "+") + "+";
    });
    return URL;
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    if (base64Image) {
      setRequiredMessage("");
      setEAPObject({ ...eapObject, image: base64Image });
      incrementStep();
    } else {
      setRequiredMessage("Sketching an Emergency Route is Required");
    }
  };

  return (
    <Form id="addForm" onSubmit={(event) => handleSubmit(event)}>
      <h4>Google Maps API URL: {}</h4>
      <MapCanvas
        src={imgSource}
        base64Image={base64Image}
        setBase64Image={setBase64Image}
      />
      {requiredMessage ? (
        <div className="form-error" style={{ paddingLeft: "40px" }}>
          {requiredMessage}
        </div>
      ) : null}
    </Form>
  );
};

export default DrawRouteForm;
